import React from "react";
import "./style.css";
import Button from "./Button";

const App = () => {
	let button = document.getElementById("too_click");
	button.addEventListener("click", () => {
		alert("someone clicked me");
	});
	return (
		<div className="todo_div">
			<h1> ToDo List</h1>
			<input
				type="text"
				name="username"
				id="txt_username"
				placeholder="Enter Your Todo"
				className="txt_username"
			/>
			<Button title="Click me!!" id="too_click" />
		</div>
	);
};

export default App;
